import React, {useState} from 'react';
import {link} from 'react-router-dom';

function Navbar() {
    return (
        <div>
            <nav className="Navbar">
                <div className="navbar-container">
                    <Link to="/" className="navbar-logo">
                        TRVL <i className='fab fa-typo3' />
                    </Link>
                </div>
            </nav>
        </div>
    )
}

export default Navbar
